//{{{  utils

//{{{  myround

function myround(x) {
  return Math.sign(x) * Math.round(Math.abs(x));
}

//}}}
//{{{  docmd

function docmd(x) {
  onmessage({data: x});
}

//}}}

//}}}
//{{{  activations

function relu(x) {
  return Math.max(0, x);
}

function crelu(x) {
  return Math.min(Math.max(x, 0), 1);
}

function srelu(x) {
  const y = Math.max(0, x);
  return y * y;
}

function screlu(x) {
  const y = Math.min(Math.max(x, 0), 1);
  return y * y;
}

